function ExpenseItem() {
    return (
      <div>
        <h2>Expense Items</h2>
        <ul>
          <li>Food Rs 10</li>
          <li>Petrol Rs 100</li>
          <li>Movies Rs 200</li>
        </ul>
      </div>
    );
  }
  
  export default ExpenseItem;
